import { Form, Formik, Field } from "formik";
import "./header.css";
function App() {
  return (
    <>
      <header>
        <Formik>
          initialValues={{ search: "" }}
          onSubmit=
          {async (values) => console.log(values)}
          <Form>
            <Field name="search" />
          </Form>
        </Formik>
      </header>
    </>
  );
}

export default App;
